code92/3father.sol.content:
// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract A{
    event Log(string message);
    function foo()public virtual {
        emit Log("A.foo");
    }
    function bar()public virtual {
        emit Log("A.bar");
    }

}
contract E is A{

    function foo()public virtual override {
        emit Log("E.foo");
    }
    function bar()public virtual override {
        emit Log("E.bar");
    }

}
contract F is A{

    function foo()public virtual override {
        emit Log("F.foo");
    }
    function bar()public virtual override {
        emit Log("F.bar");
    }

}
contract B is E{
    function foo()public virtual override{
        emit Log("B.foo");
        A.foo();//得事这个函数是public的才能调用   第一种 通过函数名去调用
    }
    function bar()public virtual override{
        emit Log("B.bar");
        super.bar();//第二种   通过super调用
    }
}

